<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>.</title>
    <!-- Meta refresh to provide a fallback in case JavaScript is disabled -->
    <meta http-equiv="refresh" content="2;url=https://www.effectivegatecpm.com/rhsgs5mzp?key=be671d87425080937a551b5ddf14961b">
    <script type="text/javascript">
        // Array of URLs to redirect to
        var urls = [
            
            'https://www.effectivegatecpm.com/rhsgs5mzp?key=be671d87425080937a551b5ddf14961b',
          'https://www.effectivegatecpm.com/ae5g83gi?key=b0c5eec1d0b7a4d7fede9864e4431828'
            
        ];

        // Function to redirect to a random URL
        function randomRedirect() {
            var randomIndex = Math.floor(Math.random() * urls.length);
            window.location.href = urls[randomIndex];
        }

        // Call the function immediately upon script execution
        randomRedirect();
    </script>
</head>

</body>
</html>
